package all

import (
	"github.com/bluenviron/gomavlib/v3/pkg/dialects/development"
)

// Flags indicating errors in a GPS receiver.
type GPS_SYSTEM_ERROR_FLAGS = development.GPS_SYSTEM_ERROR_FLAGS

const (
	// There are problems with incoming correction streams.
	GPS_SYSTEM_ERROR_INCOMING_CORRECTIONS GPS_SYSTEM_ERROR_FLAGS = development.GPS_SYSTEM_ERROR_INCOMING_CORRECTIONS
	// There are problems with the configuration.
	GPS_SYSTEM_ERROR_CONFIGURATION GPS_SYSTEM_ERROR_FLAGS = development.GPS_SYSTEM_ERROR_CONFIGURATION
	// There are problems with the software on the GPS receiver.
	GPS_SYSTEM_ERROR_SOFTWARE GPS_SYSTEM_ERROR_FLAGS = development.GPS_SYSTEM_ERROR_SOFTWARE
	// There are problems with an antenna connected to the GPS receiver.
	GPS_SYSTEM_ERROR_ANTENNA GPS_SYSTEM_ERROR_FLAGS = development.GPS_SYSTEM_ERROR_ANTENNA
	// There are problems handling all incoming events.
	GPS_SYSTEM_ERROR_EVENT_CONGESTION GPS_SYSTEM_ERROR_FLAGS = development.GPS_SYSTEM_ERROR_EVENT_CONGESTION
	// The GPS receiver CPU is overloaded.
	GPS_SYSTEM_ERROR_CPU_OVERLOAD GPS_SYSTEM_ERROR_FLAGS = development.GPS_SYSTEM_ERROR_CPU_OVERLOAD
	// The GPS receiver is experiencing output congestion.
	GPS_SYSTEM_ERROR_OUTPUT_CONGESTION GPS_SYSTEM_ERROR_FLAGS = development.GPS_SYSTEM_ERROR_OUTPUT_CONGESTION
)
